As a software developer supporting autonomous freight routing research, I will create a single Markdown document that contains a ready-to-run OverpassQL query and clear step-by-step instructions for generating a filtered OpenStreetMap dataset. The deliverable explains how to extract Interstate 40 way relations, nodes, and relevant metadata between Albuquerque, NM and Oklahoma City, OK, specifically tailored for analyzing speed limits and lane availability. The file is intended for engineers and analysts who will run the query in the Overpass Turbo interface and export the resulting dataset for downstream modeling and simulation.

overpassql
[out:json][timeout:180];

// Define a rough bounding box that covers Albuquerque to Oklahoma City
(
  relation["ref"="I 40"]["type"="route"]["route"="road"]
    (34.8,-107.5,35.6,-97.3);
)->.i40_relations;

// Get all ways that are members of the I-40 relations
way(r.i40_relations)->.i40_ways;

// Get all nodes that make up those ways
node(w.i40_ways)->.i40_nodes;

// Output everything with full metadata
(
  .i40_relations;
  .i40_ways;
  .i40_nodes;
);
out meta;

